import React from "react";

import bgImage from "../assets/oseaay.jpg";
import { Box } from "@mui/material";

const HomePage = () => {
  return (
    <Box
      sx={{
        backgroundSize: "cover",
        backgroundPosition: "center",
        width: "100%",
        height: "100%",
        backgroundImage: `url(${bgImage})`,
      }}
    ></Box>
  );
};

export default HomePage;
